import React from 'react';
import UserDetails from './UserDetails';

export const initialValues = {
    email: '',
    name: '',
    gender: '',
    locations: ''
};
export default function NewUserForm() {
    return <>
        <h2>Add User</h2>
        <UserDetails initialValues={initialValues} />
    </>
}
